import React from "react"
class App extends React.Component{
    render(){
        const [img,para,title]=this.props.info
        return(
            <div>
                <img src={img}/><br/>
                Heading:{para}<br/>
                title:{title}<br/>
            </div>
        )
    }    
    }
    class App1 extends React.Component{
        state={
            people:[
                {img:"",para:"i am going to the future planning on gthe nature",title:"Nature"},
                {img:"https://images.pexels.com/photos/2166711/pexels-photo-2166711.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2",para:"i am going to the future planning on gthe nature",title:"LOcaton"}
            ]
        }
        render(){
            return(
                <div>
                    {this.state.people.map(item=>(
                        <App info={item}/>
                    ))}
                </div>

            )
        }     
        }
        export default App1;
